Reference: AtCoder library https://atcoder.github.io/ac-library/production/document_en/index.html A lazy segment tree is a data struture for a pair of a monoid \( (S, \cdot : S \times S \rightarrow S, e \in S) \) and a set \(F\) of \(S \rightarrow S\) mappings that satisfies the following properties: \(F\) contains the identity mapping \(Id\) such that \( Id(x) = x \) for all \(x\in S\). \(F\) is closed under composition. That is, \( f \circ g \in F \) for all \( f, g \in F \). \( f (x \cdot y) = f(x) \cdot f(y) \) hold for all \(f \in F \) and \( x, y \in S \). Given an array \(A\) of length \(n\) consists of the monoid \(S\) as described above, a segment tree on it can process the following queries in \(O (\log{n})\) time: Apply the mapping \( f \in F \) on all the elements of an interval Calculate the product of the elements of an interval assuming that calculating the product of two elements takes \(O(1)\) time. fn ceil_pow2(n: usize) -> usize { let mut x: usize = 0; while (1 << x) < n { x += 1; } x
} /// Represents a monoid in a lazy segment tree $(S, \cdot)$.
trait Monoid { fn opr(&self, other: &Self) -> Self; fn e() -> Self;
} /// Represents a map $F$ acting on the monoid $(S, \cdot)$.
trait Mapping<T: Monoid> { fn map(&self, apply: &T) -> T; fn compos(&self, other: &Self) -> Self; fn id() -> Self;
} /// Lazy segment tree for the monoid $(S, \cdot)$ and the map $F$.
struct LazySeg<S: Monoid, F: Mapping<S>> { n: usize, size: usize, log: usize, data: Vec<S>, lazy: Vec<F>,
} impl<S, F> LazySeg<S, F>
where S: Monoid + Clone, F: Mapping<S> + Clone,
{ fn update(&mut self, k: usize) { self.data[k] = self.data[k << 1].opr(&self.data[(k << 1) + 1]); } fn all_apply(&mut self, k: usize, f: &F) { self.data[k] = f.map(&self.data[k]); if k < self.size { self.lazy[k] = f.compos(&self.lazy[k]); } } fn push(&mut self, k: usize) { self.all_apply(k << 1, &self.lazy[k].clone()); self.all_apply((k << 1) + 1, &self.lazy[k].clone()); self.lazy[k] = F::id(); } /// Initializes the lazy segment tree from the given array. fn new(arr: &Vec<S>) -> Self { let log = ceil_pow2(arr.len()); let mut ls: Self = LazySeg { n: arr.len(), log, size: 1 << log, data: vec![S::e(); 1 << (log + 1)], lazy: vec![F::id(); 1 << log], }; for (i, v) in arr.into_iter().enumerate() { ls.data[ls.size + i] = (*v).clone(); } for i in (1..ls.size).rev() { ls.update(i); } ls } /// Sets a value at the index `i` to `v`. fn set(&mut self, i: usize, v: &S) { let i = i + self.size; for j in (1..=self.log).rev() { self.push(i >> j); } self.data[i] = v.clone(); for j in 1..=self.log { self.update(i >> j); } } /// Returns a reference to the value at the index `i`. fn get(&mut self, i: usize) -> &S { let i = i + self.size; for j in (1..=self.log).rev() { self.push(i >> j); } &self.data[i] } /// Returns a product of elements in [l, r). fn prod(&mut self, l: usize, r: usize) -> S { if l == r { return S::e(); } let (mut l, mut r) = (l + self.size, r + self.size); for i in (1..=self.log).rev() { if ((l >> i) << i) != l { self.push(l >> i); } if ((r >> i) << i) != r { self.push((r - 1) >> i); } } let (mut sml, mut smr) = (S::e(), S::e()); while l < r { if l & 1 == 1 { sml = sml.opr(&self.data[l]); l += 1; } if r & 1 == 1 { r -= 1; smr = self.data[r].opr(&smr); } l >>= 1; r >>= 1; } sml.opr(&smr) } /// Returns the product of every elements. fn all_prod(&self) -> S { self.data[1].clone() } /// Apply a map `f` to the element at `i`. fn apply(&mut self, i: usize, f: &F) { let i = i + self.size; for j in (1..=self.log).rev() { self.push(i >> j); } self.data[i] = f.map(&self.data[i