struct Elm { len: i128, sum: i128,
} impl Monoid for Elm { fn opr(&self, other: &Self) -> Self { Self { len: self.len + other.len, sum: self.sum + other.sum, } } fn e() -> Self { Self { len: 0, sum: 0 } }
} #[derive(Clone)]
struct Map { mul: i128, add: i128,
} impl Mapping<Elm> for Map { fn map(&self, apply: &Elm) -> Elm { Elm { len: apply.len, sum: self.mul * apply.sum + self.add * apply.len, } } fn compos(&self, other: &Self) -> Self { Self { mul: self.mul * other.mul, add: self.mul * other.add + self.add, } } fn id() -> Self { Self { mul: 1, add: 0 } }
