} struct SccStack { stack: Vec<u32>, check: Vec<bool>,
} impl SccStack { fn new(cap: u32) -> Self { Self { stack: vec![0; cap as usize], check: vec![false; cap as usize], } } fn len(&self) -> u32 { self.stack.len() as u32 } fn push(&mut self, n: u32) { self.stack.push(n); self.check[n as usize] = true; } fn get(&self) -> u32 { self.stack[self.len() as usize - 1] } fn pop(&mut self) -> u32 { let tmp = self.stack.pop().unwrap(); self.check[tmp as usize] = false; tmp } fn is_in(&self, n: u32) -> bool { self.check[n as usize] }
