} impl<'g, T: 'g> SCC<'g, T> { fn new(graph: &'g Graph<T>) -> Self { let mut st = SccStack::new(graph.n); let mut list: Vec<Vec<u32>> = Vec::new(); let mut gid: u32 = 0; let mut id = vec![graph.n; graph.n as usize]; let mut low = vec![u32::MAX; graph.n as usize]; for x in 0..graph.n { if id[x as usize] != graph.n { continue; } Self::dfs(graph, x, &mut gid, &mut id, &mut low, &mut st, &mut list) } list.reverse(); let mut ids = vec![0u32; graph.n as usize]; for (i, l) in list.iter().enumerate() { for &v in l.iter() { ids[v as usize] = i as u32; } } Self { graph, scc_list: list, scc_ids: ids, } } fn dfs( graph: &Graph<T>, curr: u32, gid: &mut u32, id: &mut Vec<u32>, low: &mut Vec<u32>, st: &mut SccStack, list: &mut Vec<Vec<u32>>, ) { st.push(curr); id[curr as usize] = *gid; low[curr as usize] = *gid; (*gid) += 1; for (next, _) in graph.neighbor(curr) { if id[next as usize] == graph.n { Self::dfs(graph, next, gid, id, low, st, list); } } for (next, _) in graph.neighbor(curr) { if st.is_in(next) { low[curr as usize] = low[curr as usize].min(low[next as usize]); } } if id[curr as usize] == low[curr as usize] { let p = list.len(); list.push(Vec::new()); while st.len() != 0 && st.get() != curr { list[p].push(st.pop()); } st.pop(); list[p].push(curr); } }
}

