/// queries: Vec<(id, l, r)>
fn mos_sort(queries: &mut [(u32, u32, u32)]) { let nsq = isqrt(queries.len() as u32); queries.sort_unstable_by(|&(_, l1, r1), &(_, l2, r2)| { if l1 / nsq == l2 / nsq { r1.cmp(&r2) } else { (l1 / nsq).cmp(&(l2 / nsq)) } });
} fn isqrt(s: u32) -> u32 { let mut x0 = s / 2; if x0 != 0 { let mut x1 = (x0 + s / x0) / 2; while x1 < x0 { x0 = x1; x1 = (x0 + s / x0) / 2; } x0 } else { s }
}

